import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

let myName = 'Lakshya Bhardwaj';
const img="https://picsum.photos/seed/picsum/600/300";

const heading = {
  color: 'palevioletred',
  textAlign: 'center',
  textTransform: 'capitalize',
  fontWeight: 'bold',
  textShadow: '0px 2px 4px palegoldenrod'
};

ReactDOM.render(<>
  <h1 style={heading} >Hello, my name is {myName}</h1>
  <p>Today's date is {new Date().toDateString()}</p>
  <p>Current time is {new Date().toLocaleTimeString()}</p>
  <div className='img_div'>
    <img src={img} alt='random image' />
    </div>
</>, document.getElementById("root"));
